(15, '20210519123447', 1, 1, 1, 'N1 読解 スピードマスター', '<p>\r\n	　不動産の仕事に就いて２０年。仕事柄、「マンションを買いたいが、いつが買い時か」という相談をよく受けます。仕事が安定して、予算や住みたい町、希望の間取りなどについて考えがまとまったなら、特に購入時期を迷う必要はないでしょう。市場でいう買い時よりも、自分自身のタイミングを重視した人のほうが、たいていは満足のいく買い物ができるようです。ただ、従来マンションを人に貸す予定がある場合は、購入時期をよく検討することをお勧めします。マンションの供給が多い時期は、だれでも住みたくなるような物件を比較的安く買えるので、好機といえます。借り手が見つかりやすいうえに、利益も期待できるからです。</p>', 1),
