INSERT INTO `chitietbaihoc` (`id`, `debai`, `cauhoi`, `traloi_1`, `traloi_2`, `traloi_3`, `traloi_4`, `dap_an`, `chu_thich`, `active`, `baihoc_id`) VALUES
(3, NULL, '<p>\r\n	わたしには　<u>姉</u>が　２人<sub>ふたり</sub>　います。</p>', 'おに', 'あね', 'けい', 'あに', 2, NULL, 0, 2),
(4, NULL, '<p>\r\n	あしたは　どようびで　<u>会社</u>は　休みです。</p>', 'あいしゃ', 'がいしゃ', 'ごうしゃ', 'かいしゃ', 1, NULL, 0, 3),
(5, NULL, '<p>\r\n	田中さん<u>兄弟</u>は　とても　なかが　いいです。</p>', 'きょうだい', 'きょうたい', 'きょだい', 'きょたい', 1, NULL, 0, 4),
(6, NULL, '<p>\r\n	５さい下の　<u>弟</u>は　とても　かわいいです。</p>', 'おとと', 'おっとと', 'おととう', 'おとうと', 4, NULL, 0, 5),
(7, NULL, '<p>\r\n	父は　車の　工場で　はたらいています。</p>', 'こじょう', 'こうじょう', 'こうじょ', 'こじょ', 2, NULL, 0, 6),
(8, NULL, '<p>\r\n	友だちの　<u>家</u>には　トイレが　４つも　あるそうです。</p>', 'や', 'け', 'いえ', 'か', 3, NULL, 0, 7),
(9, NULL, '<p>\r\n	わたしの　<u>へや</u>に　小さな　ソファが　あります。</p>', '平家', '部家', '平屋', '部屋', 4, NULL, 0, 8),
(10, NULL, '<p>\r\n	もう少し　<u>ひろい</u>　ところに　すみたいです。</p>', '放い', '広い', '大い', '多い', 2, NULL, 0, 9),
(11, NULL, '<p>\r\n	うちの　ちかくには　<u>みどり</u>が　多いです。</p>', '緑', '録', '緑', '禄', 3, NULL, 0, 10),
(12, NULL, '<p>\r\n	これは　<u>わたし</u>が　きのう　わすれた　かさです。</p>', '妹', '私', '弟', '兄', 2, NULL, 0, 11),
(13, NULL, '<p>\r\n	なつやすみに　<u>かぞく</u>で　ほっかいどうへ　行きます。</p>', '家波', '家旅', '家派', '家族', 4, NULL, 0, 12),
(14, NULL, '<p>\r\n	えきから　がっこうまで　<u>とおい</u>ですか。</p>', '遠い', '遅い', '速い', '近い', 1, NULL, 0, 13),
(15, NULL, '<p>\r\n	にわで　いろいろな　花を　<u>育て</u>て　います。</p>', 'たて', 'そだて', 'かて', 'まいて', 2, NULL, 0, 14),
(16, NULL, '<p>\r\n	筆者は、自宅用マンションを購入する場合の買い時はどんな時だと述べているか。</p>', '仕事が安定し、マンションを買いたいと思った時', 'マンションの供給が多い時期', 'タイミングが大事だとわかった時', '誰でも住みやすい、いいマンションに出会えた時', 1, NULL, 0, 15),
(17, NULL, '<p>\r\n	これからのお二人の<u>幸せ</u>を祈<sub>いの</sub>っております。</p>', 'しあわせ', 'こうせ', 'しああせ', 'さちせ', 1, NULL, 0, 16),
(18, NULL, '<p>\r\n	金曜日に<u>留学生</u>の友だちとパーテイーをするんだけど、来る？</p>', 'りうがくせい', 'りゅうがくせい', 'りゅがくせい', 'りゅうかくせい', 2, NULL, 0, 17),
(19, NULL, '<p>\r\n	彼は新入社員だから、まだ<u>経験</u>も少ない。</p>', 'けいけ', 'けいげん', 'けいけん', 'けけん', 3, NULL, 0, 18),
(20, NULL, '<p>\r\n	就職<sub><font size=\"1\">しゅうしょく</font></sub>してからは<u>自由</u>な時間が少なくなった。</p>', 'じゆう', 'じゆ', 'じゅう', 'じいう', 1, NULL, 0, 19),
(21, NULL, '<p>\r\n	川上か<sub>わかみ</sub>さんの好きな<u>映画</u>は何ですか。</p>', 'えか', 'えが', 'えいか', 'えいが', 4, NULL, 0, 20),
(22, NULL, '<p>\r\n	孫と撮ったこの写真は、わたしの<u>宝物</u>です。</p>', 'たからぶつ', 'たからもつ', 'たからもち', 'たからもの', 4, NULL, 0, 21),
(23, NULL, '<p>\r\n	これからのお二人の<u>幸せ</u>を祈<sub>いの</sub>っております。</p>', 'しあわせ', 'こうせ', 'しああせ', 'さちせ', 1, NULL, 0, 22),
(24, NULL, '<p>\r\n	あなたのやさしさは<u>決して</u>忘れない。</p>', 'けつして', 'けっして', 'きして', 'げして', 2, NULL, 0, 23),
(25, NULL, '<p>\r\n	千葉<sub>ちば</sub>にある友だちのアパートを<u>訪ねた</u>。</p>', 'おとずねた', 'ほうねた', 'たずねた', 'たすねた', 3, NULL, 0, 24),
(26, NULL, '<p>\r\n	映画に感動して、<u>なみだ</u>が止まらなかった。</p>', '深', '涙', '泳', '泣', 2, NULL, 0, 25),
(27, NULL, '<p>\r\n	地方の都市でも、外国人の<u>かんこう</u>客が増えている。</p>', '観好', '勧好', '観光', '勧光', 3, NULL, 0, 26),
(28, NULL, '<p>\r\n	出かける前に、すべての窓を<u>しめた</u>。</p>', '開めた', '閉めた', '門めた', '問めた', 2, NULL, 0, 27),
(29, NULL, '<p>\r\n	子犬たちが気持ちよさうに<u>ねて</u>いる。</p>', '睡て', '眠て', '寝て', '値て', 3, NULL, 0, 28),
(30, NULL, '<p>\r\n	急にシャワーのお<u>ゆ</u>が出なくなった。</p>', '油', '熱', '温', '湯', 4, NULL, 0, 29),
(31, NULL, '<p>\r\n	ホテルのフロントに<u>れんらく</u>した。</p>', '連絡', '連格', '練格', '練絡', 1, NULL, 0, 30),
(32, NULL, '<p>\r\n	最近<sub>さいきん</sub>太ったきたので、少し体を（　　　　　）。</p>', '休めよう', '動かそう', '見てみよう', '治そう', 2, NULL, 0, 31),
(33, NULL, '<p>\r\n	マンションの下の階の人から、「うるさい」と（　　　　）が来た。</p>', '確認かくにん', '指示しじ', '評判ひょうばん', '苦情くじょう', 4, NULL, 0, 32),
(34, NULL, '<p>\r\n	午後は学校の（　　　　）コートでテニスをする</p>', '室外', '課外', '場外', '屋外', 4, NULL, 0, 33),
(35, NULL, '<p>\r\n	週刊誌<sub>しゅうかんし</sub>の記事<sub>きじ</sub>が広がり、大臣<sub>だいじん</sub>が職<sub>しょく</sub>を（　　）。</p>', 'とびだした', 'やすんだ', 'はなれた', 'きめた', 3, NULL, 0, 34),
(36, NULL, '<p>\r\n	川村<sub>かわむら</sub>さんはお母さんが顔が（　　）だ。</p>', 'しっかり', 'そっくり', 'びっくり', 'こっそり', 2, NULL, 0, 35),
(37, NULL, '<p>\r\n	時間に遅れて、みんなには　（　　　）。</p>', '悪かった', '難しかった', '痛かった', '良かった', 1, NULL, 0, 36),
(38, NULL, '<p>\r\n	あしたから一週間、デパートで（　　）が行われる。</p>', 'バーゲン', 'デリバリー', 'ミーテイング', 'コマーシャル', 1, NULL, 0, 37),
(39, NULL, '<p>\r\n	洋服が増えたので、新しい（　　　）を買った。</p>', '押し入れ', '引き出し', 'あみだな', 'たんす', 4, NULL, 0, 38),
(40, NULL, '<p>\r\n	入学式は予定どおり、（　　）に終わった。</p>', '無理', '無断むだん', '無事', '無視むし', 3, NULL, 0, 39),
(41, NULL, '<p>\r\n	さあ、乾杯<sub>かんぱい</sub>、みなさん（　　　　）を持ってください。</p>', 'はいざら', 'グラス', 'はし', 'タイマー', 2, NULL, 0, 40),
(42, NULL, '<p>\r\n	大野おおのさんは、学費を生活費のため、（　　　）をしている。</p>', 'ボランテイア', 'トレーニング', 'カウセリング', 'アルバイト', 4, NULL, 0, 41),
(43, NULL, '<p>\r\n	参加費の支払いは、後で<u>かまいません</u>。</p>', 'あまります', '大丈夫です', '集めます', '同じです', 2, NULL, 0, 42),
(44, NULL, '<p>\r\n	彼は最近<sub>さいきん</sub>、仕事に<u>はりきって</u>いる。</p>', '努力して', '苦労して', '手を出して', 'やる気を出して', 4, NULL, 0, 43),
(45, NULL, '<p>\r\n	この仕事は、<u>早目に</u>やってください。</p>', '今すぐ', 'なるべく急いで', 'いつでも', '今日中に', 2, NULL, 0, 44),
(46, NULL, '<p>\r\n	駅前の店はどこも<u>繁盛</u>している。</p>', 'びんしょう', 'びんじょう', 'はんしょう', 'はんじょう', 4, '<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>', 0, 45),
(47, NULL, '<p>\r\n	<u>契約</u>の内容について、こちらの書類をご覧ください。</p>', 'せいやく', 'けいやく', 'こうやく', 'ようやく', 2, NULL, 0, 46),
(48, NULL, '<p>\r\n	この国は、昔から貿易によって<u>潤って</u>きた</p>', 'もうかって', 'まかなって', 'あきなって', 'うるおって', 4, NULL, 0, 47),
(49, NULL, '<p>\r\n	警備は<u>手薄</u>なところがないか調べた。</p>', 'しゅうす', 'しゅはく', 'てうす', 'てはく', 1, NULL, 0, 48),
(50, NULL, '<p>\r\n	開発のために、古いビルが次々と<u>壊れて</u>いる。</p>', 'こわされて', 'くずされて', 'たおされて', 'つぶされて', 1, NULL, 0, 49),
(51, NULL, '<p>\r\n	おりんビックが<u>華々しく</u>開幕した。</p>', 'はなばなしく', 'おもおもしく', 'ものものしく', 'そうぞうしく', 1, NULL, 0, 50),
(52, NULL, '<p>\r\n	この連載小説は全12話で（　　　　）する</p>', '静止', '成就', '完結', '終息', 3, NULL, 0, 51),
(53, NULL, '<p>\r\n	会議で質問に答えられなくて困っていたら、課長が（　　　）してくれた。</p>', 'キープ', 'フォロー', 'マッチ', 'アップ', 2, NULL, 0, 52),
(54, NULL, '<p>\r\n	この春、とうとう（　　　）のマイホームを手に入れた。</p>', '切望', '欲望', '念願', '志願', 3, NULL, 0, 53);
