(152, NULL, NULL, NULL, NULL, '34.6012264', '135.817343', NULL, NULL, 'Cần tìm 1 bạn thạo đi tàu, dẫn thực tập sinh đi tàu ngày 25/5 (Thứ 3), lộ trình như sau:\r\n1/ Đón tts tại kỹ nghiệp đoàn, địa chỉ\r\n奈良県天理市前栽町224-1\r\n\r\n2/ Dẫn bạn đến ga bên dưới, và cùng đi đến ga kyoto \r\n前栽駅　(きんてつせんざい) →京都駅\r\n\r\n3／Tới ga kyoto, mua vé 新幹線 自由席 từ 京都 đến 東京駅\r\n●Mua vé cho 1 mình bạn TTS thôi\r\n●Người đối ứng mua vé 入場券 để vào tận bên trong đưa bạn tts lên đúng toa tàu số 2 自由席, khi tàu rời thì mới về\r\nChú ý: tất cả các vé phải giữ lại hoá đơn đi lại và gửi hình chụp sau khi đối ứng xong.\r\nTừng giai đoạn phải báo cáo và chụp hình gửi vao nhóm line của nghiệp đoàn để nđ nắm thông tin\r\nVd: đã đón bạn tại ktx chuẩn bị ra ga, chụp một tấm hình tại đây và báo cáo, đã lên tàu hướng về kyoto,...\r\n\r\n4/ Tại Tokyo Mirai sẽ đón trực tiếp bạn ở toa số 2 của chuyến tàu tương ứng và dẫn bạn đi đến sân bay, đồng thời hỗ trợ các thủ tục tiếp theo.', '奈良県天理市前栽町224-1', '10:00', '2021-05-23', NULL, NULL, 0, 0, 6, '2021-05-27 12:49:31', '2021-05-27 12:49:31', 16, 0, NULL, NULL, '2021-05-26', NULL, NULL, NULL, 1000, NULL, NULL, ',1,', 21670, 21670, 1, NULL, 20670, 1, NULL, '奈良県天理市前栽町224-1', 0, 0, '2021-05-25', NULL, 92, '20210523102845', 1, 4000, 10.21, 408, 0, 500, 16670, NULL, 5000, 0, 1),
