(95, '2021-03-15', '17:30', '+ 17:30 tại ga warabi\r\n+18:00 – 20:30 dịch tại kí túc công ty\r\nNhững vấn đề của TTS : Hai bạn tts Dũng Và Sơn.\r\n1.Dũng(30t) công ty rất hài lòng. Công việc cố gắng thái độ làm việc tuân thủ nội quy giờ\r\ngiấc.Tiếng nhật cố gắng học. Đã đậu chứng chỉ tiếng nhật N4 và tiếp tục ôn luyện N3. Hỏi\r\nvề tiền thưởng của nghiệp đoàn khi thi đỗ N4. Nghiệp đoàn sẽ xác nhận và chuyển tiền\r\nthưởng vào tài khoản.\r\n2.Sơn(22t) chưa cố gắng nên công ty rất phiền lòng. Thường xuyên nói dối, không cố gắng\r\ngiao tiếp để xây dựng mối quan hệ đồng nghiệp trong công ty. Như đi ăn một mình, ngủ trên\r\nxe khi đến công trình, trên xe đồng nghiệp hỏi nói truyện thì viện lí do ko biết tiếng nhật để\r\nko nói. Quần áo đầu tóc tác phong không phù hợp với tiêu trí của ttts.\r\nTái sai phạm nhiều lần dẫn đến mất long tin của công ty. Tiếng nhật yếu nhưng chưa chịu\r\ncố gắng khắc phục nên ngại giao tiếp xa cách với đồng nghiệp cấp trên .\r\nChi tiêu chưa hợp lí phải mượn tiền của giám đốc để chi trả sinh hoạt phí.\r\nToàn bộ vấn đền trên cam kết sẽ không tái phạm. Cố gắng ôn luyện tiếng nhật thông qua you\r\ntube. Công ty đồng ý tài trợ thêm tiêng học tiếng nhật nếu cần thiết.', 7000, 136, NULL, NULL, 54, 56, '20:30', '0'),
