(110, '2021-03-28', '13:00', 'TTS tham dự:4 người.\r\nPhía công ty:2 người.\r\nNội dung:\r\n1. Phổ biến an toàn lao động. Nhắc nhở chú ý tránh tai nạn.\r\n2. Học tiếng nhật: viết kanji cơ bản.\r\n3. Thông báo : tháng 6-7: sẽ có thêm 2 bạn từ Việt Nam qua.\r\n4. Hai bạn: Mạnh, Ngọc, chuẩn thị thi chuyển giai đoạn vào cuối tháng 12.\r\n5. Hai bạn : Trung, Duy, hết năm 4. Sẽ thông báo lịch về nước, và quay lại( Trung). Duy về nước luôn.\r\nNhận xét: công ty rất quan tâm đến TTS', 0, 1610, NULL, NULL, 69, 69, '15:00', '0'),
