(114, '2021-04-02', '08:40', '1. 8:40 gặp tanto tại ga nizza\r\n2. 9:00-15:30. Dạy tiếng nhật: trong công việc, chào hỏi. Giải thích an toàn lao động. Hợp đồng lao động. Bảng lương. Ngày và giờ làm việc. Giải thích sự khác nhau giữa hợp đồng cũ và mới.\r\n3. TTS đã đồng ý và ký vào biên bản thoả thuân.\r\n4. 15:30-17:30 trao đổi phía nhà máy về sự hiểu lầm giữa hai bên trong nội dung hợp đồng mới. Giám đốc chấp nhận lời xin lỗi và đã cho TTS đi làm việc lại bắt đầu thứ hai ngày 5/4.', 0, 2000, NULL, NULL, 73, 74, '17:30', '0'),
