(135, '2021-04-11', '10:00', 'Địa điểm tập trung: 下妻イオンモール\r\nThời gian tập trung: 10:00\r\nSố người tập trung: Giám đốc nhà máy ダイショー là bác中野\r\n　　　 Chị Quyên người của nghiệp đoàn\r\n10:00 ~ 10:10 phút, thảo luận kế hoạch trong ngày, lịch trình đi, nội dung công việc\r\nĐi tìm kiếm Thực tập sinh Nguyễn Thị Hà, xem thực tập sinh đó có ở địa chỉ đó không, để trao đổi về vấn đề công việc của bạn ấy.\r\n10:11~ xuất phát từ下妻イオンモール tới địa điểm 1\r\n\r\nĐịa điểm 1: 茨城県結城郡八千代町村貫850-2\r\nコープかおりビルディング　B202\r\n\r\nKhoảng 10:40 tới địa điểm 1\r\nThực hiện tìm kiếm theo kế hoạch, nhưng ở phòng B202 không có ai ở nhà\r\nTiếp tục đi tới địa điểm 2\r\n\r\nĐịa điểm 2: 千葉県船橋市若松2-8-13 504号\r\n\r\nKhoảng 12:20 tới địa điểm 2, thực hiện tìm kiếm theo kế hoạch, ở phòng 504 không có ai ở nhà.\r\nnên 3 người tạm nghỉ giải lao\r\nKhoảng 13:20 quay lại địa điểm 2 tìm kiếm một lần nữa, thì lần này có người ở nhà, nhưng người này lại không biết bạn Hà là ai, và cũng không hiểu sao bạn Hà lại biết địa chỉ này. Địa chỉ này là do bên công ty thuê cho các bạn đó, nên người lạ không được vào ( ở địa chỉ này có 3 người ở, thì thời điểm trưa nay chỉ 1 bạn ở nhà, và bạn ấy không biết bạn Hà là ai)\r\n\r\nKết thúc quá trình tìm kiếm ở địa điểm 2. Tiếp theo quay lại địa điểm 1 tìm kiếm tiếp\r\nKhoảng 16:10 về tới địa điểm 1 thì phòng B202 vẫn không có ai ở nhà, khi đó có hỏi phòng bên cạnh về thông tin ai ở phòng B202, và có nói chuyện với 1 bác người Nhật ở cùng khu アパート đó, thì nắm được thông tin, bạn Hà không tới đây.\r\nKết thúc quá trình tìm kiếm ở 2 địa điểm, quay lại địa điểm tập trung\r\nTới 17:00 thì quay về tới địa điểm tập trung.\r\nChào hỏi, tạm biệt kết thúc ngày làm việc.', 8000, 2000, NULL, '/public/media/userfiles/files/hoadon.jpg', 94, 86, '17:00', '0'),
(136, '2021-04-20', '9:30', '実習生の数:4人\r\n9:30 柏駅で組合の担当者に町合わせ\r\n10:10-11:00実習実施社につき,実習生に会って,この間で受けた試験で4人とも落とされた。原因よくわからなく,再試験を受けたいという希望を受け取って組合と実習実施社に伝え,また,実習生を抱え込む悩みや生活上などで困ったことなどを解決した。\r\n11:00-11:30労働契約に関する雇入れ資料などを観察し,不平等のところなどがあるかないかチェック。', 8000, 1146, NULL, NULL, 95, 88, '11:30', '0'),
