INSERT INTO `mail_template` (`id`, `name`, `from_mail`, `to_mail`, `cc_mail`, `subject`, `body`, `note`) VALUES
(8, '１－通訳依頼通知', 'support@alphacep.co.jp', 'AlphaCep事務局 <support@alphacep.co.jp>', '[your-email]', '[通訳依頼] 受注番号: [ordernumber]', 'Dear [name]<br>\r\n<br>\r\n\r\nPhòng kinh doanh, Công ty phái khiển phiên dịch AlphaCep.<br>\r\n<br>\r\n\r\nAlphaCep chọn bạn là phiên dịch viên cho lịch phiên dịch dưới đây.<br>\r\n<br>\r\n\r\n--------------------------------------------<br>\r\nPhiên dịch viên hãy xác nhận những nội dung dưới đây.<br>\r\nNếu không có vấn đề gì thì, <b><u><a href=\"#\" style=\"color:red;\">trong vòng 2 ngày hãy phản hồi trực tiếp lại Email này.</a></u></b><br>\r\nMail phản hồi chỉ cần trả lời [Đã nhận lịch dịch] .<br>\r\n--------------------------------------------<br>\r\n<br>\r\n\r\n<b>Mã số：[ordernumber]</b><br>\r\n<br>\r\n\r\n■<b><u>Lịch trình phiên dịch</b></u><br>\r\nNgày phiên dịch： [dateinterpreter] <br>\r\nNội dung phiên dịch：[workcontent]<br>\r\nĐịa điểm：[workplace]<br>\r\nThời gian：[worktime]<br>\r\n<br>\r\n\r\n■<b><u>Phiên dịch viên</b></u><br>\r\nHọ và tên：[name]<br>\r\nCách gọi trong Tiếng Nhật：[othername]<br>\r\nSố điện thoại：[phone]<br>\r\nĐịa chỉ Email：[your-email]<br>\r\n<br>\r\n\r\n■<b><u>Phí phiên dịch</b></u><br>\r\n※Phí phiên dịch đã bao gồm phí giao thông (phí xe điện, phí xe hơi, phí gởi xe...). <br>\r\nTuy nhiên, trong quá trình phiên dịch có phát sinh phí giao thông khác, công ty sẽ trả dựa trên hóa đơn thanh toán thực tế.<br>\r\n<br>\r\n\r\n■<b><u>Những điểm lưu ý</b></u><br>\r\n・Trước ngày phiên dịch 1 ngày, phía công ty khách hàng sẽ liên lạc để xác nhận lịch trình. Phiên dịch viên hãy trả lời điện thoại hoặc tin nhắn.<br>\r\n\r\n<div style=\"color: red\">\r\n・Sau khi phiên dịch xong, nếu khách hàng hỏi thông tin ngân hàng để chuyển khoản phí phiên dịch thì phiên dịch viên gởi thông tin như dưới đây:<br>\r\n  銀行名：ゆうちょ銀行<br>\r\n  記号：10570<br>\r\n  番号：87655811<br>\r\n  口座名義人名：ジェン　ティ　タン　ガー<br>\r\n</div><br>\r\n\r\n・Sau khi kết thúc một ngày phiên dịch, phiên dịch viên hãy điền vào form báo cáo phiên dịch theo link dưới đây.<br>\r\n　http://alphacep.co.jp/report_interpreter/<br>\r\n  ※Trong trường hợp phiên dịch kéo dài nhiều ngày, phiên dịch viên hãy gửi báo cáo theo từng ngày.<br>\r\n\r\n<div style=\"color: red\">・Phí phiên dịch sẽ được thanh toán trong vòng 2 tuần sau khi nhận được báo cáo kết thúc phiên dịch.</div><br>\r\n\r\n・Có khách hàng sẽ thanh toán phí phiên dịch trực tiếp cho phiên dịch viên. <br>\r\n  Trong trường hợp đó, phiên dịch viên sau khi đã nhận phí phiên dịch từ khách hàng, hãy liên lạc với AlphaCep.<br>\r\n  AlphaCep sẽ gửi cho phiên dịch viên [phiếu yêu cầu thanh toán phí phái khiển]. <br>\r\n  Phiên dịch viên thanh toán phí phái khiển cho AlphaCep bằng chuyển khoản ngân hàng. Phí chuyển khoản ngân hàng AlphaCep sẽ chịu. <br>\r\n<br>\r\n\r\n<br>\r\n<br>\r\nHãy liên hệ với chúng tôi nếu có bất kỳ vấn đề gì.<br>\r\n\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●<br>\r\nCông ty cổ phần AlphaCep<br>\r\n〒273-0111 Tỉnh Chiba,Thành phố Kamagaya,Kitanakazawa 1-18-22 Sukara Building 3F<br>\r\nTEL: 0474-022-022<br>\r\nHP: http://www.alphacep.co.jp<br>\r\n<a href=\"http://www.alphacep.co.jp/contact/\">Form gửi yêu cầu</a><br>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●<br>', '[name] : ten phien dich\r\n\r\n[ordernumber]: ma so job\r\n\r\n[dateinterpreter] : ngay phien dich\r\n[workcontent]: Nội dung phiên dịch\r\n[workplace] : Địa điểm gap mat (待合せ場所)\r\n[worktime] : thoi gian gap mat (待合せ時間:)\r\n\r\n\r\n[othername]: Cách gọi trong Tiếng Nhật (ふりがな) cua phien dich\r\n[phone] : so dien thoai nguoi phien dich cua phien dich\r\n[your-email] : email nguoi phien dich cua phien dich'),
(9, '３－手配手数料請求', 'AlphaCep事務局 <support@alphacep.co.jp>', 'support@alphacep.co.jp', '[your-email]', '[通訳者手配手数料のご請求] 受注番号: [ordernumber] (通訳日：[dateinterpreter])', '[name_interpreter] 様<br>\r\n<br>\r\nお世話になります。<br>\r\n通訳派遣 AlphaCep 事務局です。<br>\r\n<br>\r\n通訳者手配手数料のご請求について、ご連絡いたします。<br>\r\n<br>\r\n■ 通訳依頼件<br>\r\n依頼番号：[ordernumber]<br>\r\n通訳日：[dateinterpreter]<br>\r\n場所：[place]<br>\r\n通訳者：[name_interpreter]<br>\r\n電話番号：[phone]<br>\r\nメールアドレス：[your-email]<br>\r\n<br>\r\n■ 請求内容<br>\r\nお客様の支払い合計金額：[customer_totalmoney]円<br>\r\n通訳者への支給合計金額：[interpreter_totalmoney]円<br>\r\n・通訳料金＝[interpreter_money]円<br>\r\n・交通費等＝[move_money]円<br>\r\n・銀行振込手数料＝[bank_money]円<br>\r\n<div style=\"color: red\">通訳者手配手数料：[total_money]円</div><br>\r\n<br>\r\n■ お振込先<br>\r\n銀行名: 　みずほ銀行<br>\r\n銀行コード:　 0001<br>\r\n支店名: 　鎌ケ谷支店<br>\r\n支店コード: 　326<br>\r\n預金種類: 　普通<br>\r\n口座番号: 　3027123<br>\r\n名義: 　ジエン　テイ　タン　ガー<br>\r\n<br>\r\n大変お手数ですが、通訳料金のご入金確認後は、<br>\r\n手配手数料のお支払いくださいますようお願い申し上げます。<br>\r\n<div style=\"color:red\">お支払いが完了しましたら、本ﾒｰﾙに直接ご返信ください。</div><br>\r\n※返信のメールに「支払完了」のみで結構です。<br>\r\n<br>\r\n<br>\r\nご不明な点がございましたら下記までお問い合わせくださいませ。<br>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●<br>\r\n株式会社AlphaCep(アルファセプ)<br>\r\n〒273-0111 千葉県鎌ケ谷市北中沢 1-18-22 スカラビル3F<br>\r\nTEL: 0474-022-022<br>\r\nHP: http://www.alphacep.co.jp<br>\r\n<a href=\"http://www.alphacep.co.jp/contact/\">お問い合わせフォーム</a><br>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●', '[name_interpreter] : ten phien dich\r\n\r\n[ordernumber] : ma order\r\n[dateinterpreter] : ngay phien dich\r\n[place] : dia chi phien dich\r\n[phone] : dien thoai nguoi phien dich\r\n[your-email] : mail nguoi phien dich\r\n\r\n[customer_totalmoney] : tong thu\r\n[interpreter_totalmoney] : tong 3 phi duoi day\r\n[interpreter_money] : tong phi phien dich\r\n[move_money] : tong phi di chuyen\r\n[bank_money]: phi chuyen khoan'),
(10, '２－通訳報告願い', 'AlphaCep事務局 <support@alphacep.co.jp>', 'support@alphacep.co.jp', '[your-email]', '通訳報告をお願い（受注番号: [ordernumber]、通訳日：[dateinterpreter])', '[name_interpreter] さま<br>\r\n<br>\r\nお世話になります。<br>\r\n通訳派遣 AlphaCep 事務局です。<br>\r\n<br>\r\n<br>\r\nご多忙の中、恐縮ですが、<br>\r\n下記の通訳依頼件、ご報告くださいますようお願い申し上げます。<br>\r\n報告方法については、下記フォームにてご記入の上ご送信願います。<br>\r\nhttp://alphacep.co.jp/report_interpreter/<br>\r\n<br>\r\n■ 通訳依頼件<br>\r\n依頼番号：[ordernumber]<br>\r\n通訳日：[dateinterpreter]<br>\r\n場所：[place]<br>\r\n通訳者：[name_interpreter]<br>\r\n電話番号：[phone]<br>\r\nメールアドレス：[your-email]<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\nご不明な点がございましたら下記までお問い合わせくださいませ。<br>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●<br>\r\n株式会社AlphaCep(アルファセプ)<br>\r\n〒273-0111 千葉県鎌ケ谷市北中沢 1-18-22 スカラ 3F<br>\r\nTEL: 0474-022-022<br>\r\nHP: http://www.alphacep.co.jp<br>\r\n<a href=\"http://www.alphacep.co.jp/contact/\">お問い合わせフォーム</a><br>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●', '[name_interpreter] : ten nguoi phien dich\r\n[ordernumber] : ma so job\r\n[dateinterpreter] : ngay phien dich\r\n[place] : dia chi phien dich\r\n[name_interpreter] : ten nguoi phien dich\r\n[phone] : dien thoai nguoi phien dich\r\n[your-email] : mail nguoi phien dich'),
(11, '４－入金確認完了通知', 'AlphaCep事務局 <support@alphacep.co.jp>', 'support@alphacep.co.jp', '[your-email]', '[通訳者手配手数料のご入金の確認] 受注番号: [ordernumber] (通訳日：[dateinterpreter])', '[name_interpreter] 様<br>\r\n<br>\r\nお世話になります。<br>\r\n通訳派遣 AlphaCep 事務局です。<br>\r\n<br>\r\n通訳依頼件(番号:[ordernumber])の手配手数料ののご入金を、<br>\r\n本日付で確認いたしました。<br>\r\n早々にお振込みお手続きをいただき、誠にありがとうございます。<br>\r\n<br>\r\n今後ともどうぞよろしくお願い致します。<br>\r\n<br>\r\nご不明な点がございましたら下記までお問い合わせくださいませ。<br>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●<br>\r\n株式会社AlphaCep(アルファセプ)<br>\r\n〒273-0111 千葉県鎌ケ谷市北中沢 1-18-22 スカラビル3F<br>\r\nTEL: 0474-022-022<br>\r\nHP: http://www.alphacep.co.jp<br>\r\n<a href=\"http://www.alphacep.co.jp/contact/\">お問い合わせフォーム</a><br>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●', '[name_interpreter] : ten phien dich\r\n[ordernumber] : ma job'),
(12, '１－通訳者へ依頼メール（日本語版）', NULL, NULL, NULL, NULL, '[name]さま\r\n\r\nお世話になります。\r\n通訳派遣 AlphaCep 事務局です。\r\n\r\n通訳の依頼が来ましたので、ご連絡させて頂きます。\r\n\r\n--------------------------------------------\r\n以下の内容をご確認ください。\r\n内容を御理解いただき、ご不明点がないようでしたら、<b><u>\r\n<a href=\"#\" style=\"color:red;\">2日以内に当メールに直接ご返信くださいますようお願いいたします。</a></u></b>\r\n返信のメールに「承りました」のみで結構です。\r\n--------------------------------------------\r\n\r\n<b>受注番号：[ordernumber]</b>\r\n\r\n■<b><u>通訳日程</b></u>\r\n通訳日： [dateinterpreter] \r\n会社名：[companyname]\r\n通訳内容：[workcontent]\r\n待合せ場所：[workplace]\r\n待合せ時間：[worktime]\r\n\r\n■<b><u>通訳者</b></u>\r\n名前：[name]\r\nふりがな：[othername]\r\n電話番号：[phone]\r\nメールアドレス：[your-email]\r\n\r\n■<b><u>通訳料金</b></u>\r\n半日料金（4時間以下）：7,000円\r\n全日料金（8時間以下）：9,000円\r\n※半日を超える場合は全日料金となります。8時間を超える場合は、延長料金（1,000円/1時間）を支給します。\r\n※交通費（電車代、車代、駐車券など）は通訳料金に含まれます。（集合場所からまた別の場所へ移動は実費を支給します）\r\n\r\n■<b><u>注意点</b></u>\r\n・通訳日の前日に、日程確認のため担当者より連絡します。電話対応をお願いします。\r\n<div style=\"color: red\">\r\n・通訳当日に、お客様からお支払い用銀行口座を聞かれた場合は、下記の指定銀行口座をお客様に通知してください。\r\n  銀行名：ゆうちょ銀行\r\n  記号：10570\r\n  番号：87655811\r\n  口座名義人名：ジェン　ティ　タン　ガー\r\n</div>\r\n・通訳後、以下の通訳完了報告フォームで通訳報告をお願いします。\r\n　http://alphacep.co.jp/report_interpreter/\r\n<div style=\"color: red\">\r\n  ※通訳料金のお支払いは、通訳完了報告を受けてから、2週間以内となります。\r\n</div>\r\n・お客様により通訳者へ直接支払制度がございます。その場合は、入金確認後、ご連絡くださいますようお願いいたします。\r\n　AlphaCepからご請求書を送付させていただきます。請求書記載の期日までお振込みいただきますよう お願い申し上げます。\r\n　また、振込手数料は「AlphaCep負担」です。ご請求金額は振込手数料を差し引いた金額になります。\r\n\r\n\r\n\r\nご不明な点がございましたら下記までお問い合わせくださいませ。\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●\r\n株式会社AlphaCep(アルファセプ)\r\n〒273-0111 千葉県鎌ケ谷市北中沢 1-18-22 スカラビル3F\r\nTEL: 0474-022-022\r\nHP: http://www.alphacep.co.jp\r\n<a href=\"http://www.alphacep.co.jp/contact/\">お問い合わせフォーム</a>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●', NULL),
(13, '５－給与振込完了通知', 'AlphaCep事務局 <support@alphacep.co.jp>', 'support@alphacep.co.jp', '[your-email]', '[通訳料金の支払い完了の通知] 受注番号: [ordernumber] (通訳日：[dateinterpreter])', '[name_interpreter] 様<br>\r\n<br>\r\nお世話になります。<br>\r\n通訳派遣 AlphaCep 事務局です。<br>\r\n<br>\r\n■ 通訳依頼件<br>\r\n依頼番号：[ordernumber]<br>\r\n通訳日：[dateinterpreter]<br>\r\n<br>\r\n本日、上記の通訳件の料金を送金致しました。<br>\r\n振込金額：[interpreter_totalmoney]円<br>\r\n------------------------------<br>\r\n・通訳料金：[interpreter_money]円<br>\r\n・交通費等：[move_money]円<br>\r\n<br>\r\nよろしくご確認のほど、お願い申し上げます。<br>\r\n<br>\r\nご不明な点がございましたら下記までお問い合わせくださいませ。<br>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●<br>\r\n株式会社AlphaCep(アルファセプ)<br>\r\n〒273-0111 千葉県鎌ケ谷市北中沢 1-18-22 スカラビル3F<br>\r\nTEL: 0474-022-022<br>\r\nHP: http://www.alphacep.co.jp<br>\r\n<a href=\"http://www.alphacep.co.jp/contact/\">お問い合わせフォーム</a><br>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●', NULL),
(14, '報酬振込完了通知', 'AlphaCep事務局 <support@alphacep.co.jp>', 'support@alphacep.co.jp', '[your-email]', '[monthyear] 報酬振込完了お知らせ', '[name_sale] 様<br>\r\n<br>\r\nお世話になります。<br>\r\n通訳派遣 AlphaCep 事務局です。<br>\r\n<br>\r\n\r\n本日、[monthyear] の報酬を送金致しました。<br>\r\n振込金額：[totalmoney]円<br>\r\n------------------------------<br>\r\n・[date1-100] ([place1-100]) : [money1-100]円<br>\r\n<br>\r\n<br>\r\nよろしくご確認のほど、お願い申し上げます。<br>\r\n<br>\r\nご不明な点がございましたら下記までお問い合わせくださいませ。<br>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●<br>\r\n株式会社AlphaCep(アルファセプ)<br>\r\n〒273-0111 千葉県鎌ケ谷市北中沢 1-18-22 スカラビル3F<br>\r\nTEL: 0474-022-022<br>\r\nHP: http://www.alphacep.co.jp<br>\r\n<a href=\"http://www.alphacep.co.jp/contact/\">お問い合わせフォーム</a><br>\r\n●○●○●○●○●○●○●○●○●○●○●○●○●○●', NULL);
